import React from "react";
import "../styles/About.css";

function About() {
  return (
    <section className="about" id="about">
      <h2>About Me</h2>
      <p>
        I'm a front-end developer with a passion for creating soft-aesthetic, user-focused interfaces.
        I love working with React, Next.js, and making beautiful websites that feel personal and polished.
      </p>
    </section>
  );
}

export default About;
